import { Card } from "../../Card.styled";
const Grid1 = ({ content }) => {
  return (
    <Card bd={"1px solid red"}>
      <Card mg={"1% 0rem"} height={"1rem"} bd={"1px solid black"}></Card>
      <Card mg={"1rem 0rem"} height={"5rem"} bd={"1px solid black"}></Card>
      <Card mg={"1rem 0rem"} height={"2rem"} bd={"1px solid black"}></Card>
      <Card mg={"1rem 0rem"} height={"2rem"} bd={"1px solid black"}></Card>
      <Card
        mg={"2.5rem 0rem 0rem 0rem"}
        height={"2rem"}
        bd={"1px solid black"}
      ></Card>
    </Card>
  );
};

export default Grid1;
